class Solution:
    def largestComponentSize(self, graph: List[List[int]]) -> int:
        components = []
        visited = set()

        for node in graph:
            if node not in visited:
                component = selfdfs(node, graph)

                if len(component) > 0:
                    components.append(len(component))

        return max(components)

    def dfs(self, node: int, graph: List[List[int]]) -> List[int]:
        visited.add(node)
        stack = [node]

        while stack:
            current_node = stack.pop()

            for neighbor in graph[current_node]:
                if neighbor not in visited:
                    stack.append(neighbor)
                    visited.add(neighbor)

        return list(set(graph[node]) - set(visited))
```

